import axios from "axios";

const baseUrl = "https://mock.codes";

export const getApi1 = async () => {
  return await axios.get(`${baseUrl}/400`);
};

export const getApi2 = async () => {
  const resp = await axios.get(`${baseUrl}/400`);
  if (resp.status !== 200) {
    throw new Error();
  }
  return resp.data;
};
